    height: 100,
    flex: 1,
    alignItems: "center",
    justifyContent: "flex-start",
    flexDirection: "row",
    paddingLeft: 80,
    backgroundColor: "rgb(248,248,248)",
  },
  text: {
    fontSize: 20,
  },
  image: {
    height: 50,
  },
